import React from 'react';
import { Link } from 'react-router-dom';
import styled from 'styled-components';

function ArticleEmployment(props) {
	return (
		<ComponentWrapper>
			<Link to="/wd/123">
				<header className="container-employment" />
				<div className="content-employment-body"></div>
			</Link>
		</ComponentWrapper>
	);
}

const ComponentWrapper = styled.div`
	.content-employment-body {
		padding: 14px 0;
	}
	.container-employment {
		padding-bottom: 75%;
		position: relative;
		background-size: cover;
		background-position: 50%;
		border-radius: 4px;
		box-shadow: inset 0 0 0 1px rgb(0 0 0 / 10%);
		background-image: url(https://image.wanted.co.kr/optimize?src=https://static.wanted.co.kr/images/company/22411/nqzjarwsifuzq9ob__400_400.jpg&w=400&q=75);
	}
`;

export default ArticleEmployment;
